package main

import "fmt"

func checkWays(pairs [][]int) int {
	if len(pairs) == 1 {
		return 2
	}

	// 统计各个点的连接情况
	linked := make(map[int][]int)
	visited := make(map[int]bool)
	for _, pair := range pairs {
		a, b := pair[0], pair[1]
		visited[a], visited[b] = true, true
		linked[a] = append(linked[a], b)
		linked[b] = append(linked[b], a)
	}
	nodeCount := len(visited)

	// 合法的根节点肯定是连接全部的点
	var maxCount int
	var roots map[int]bool
	for node, edges := range linked {
		if maxCount < len(edges) {
			maxCount = len(edges)
			roots = make(map[int]bool)
			roots[node] = true
		} else if maxCount == len(edges) {
			roots[node] = true
		}
	}
	if maxCount != nodeCount-1 {
		return 0
	}

	// 如果最多连接的点只有一个，那么这种情况下，根节点只能选这个，ways 初始值为 1
	// 否则可以有很多个根节点，ways 初始值为 2
	ways := len(roots)
	if ways > 2 {
		ways = 2
	}

	// 从 roots 取出一个节点作为根节点，开始分组。
	var root int
	for node, _ := range roots {
		root = node
		break
	}
	var subSets []map[int]bool
	inSet := make(map[int]bool)
	for _, node := range linked[root] {
		// 根节点点或者已经加入集合的节点跳过
		if roots[node] || inSet[node] {
			continue
		}
		// 基于当前点，划出一个集合
		subSet := make(map[int]bool)
		subSet[node], inSet[node] = true, true
		queue := []int{node}
		for len(queue) > 0 {
			curr := queue[0]
			queue = queue[1:]
			for _, a := range linked[curr] {
				if roots[a] || subSet[a] { // 根节点或者已经在当前集合跳过
					continue
				}
				if inSet[a] { // 不在当前集合。那说明访问到了其他节点的数据，这样成环了，失败，直接返回 0
					return 0
				}
				subSet[a], inSet[a] = true, true
				queue = append(queue, a)
			}
		}
		subSets = append(subSets, subSet)
	}
	// 成功分组，开始处理子组
	for _, subSet := range subSets {
		// 子集只有一个节点，那么这个子节点的父节点只能是根节点
		if len(subSet) == 1 {
			var node int
			for n, _ := range subSet {
				node = n
			}
			if len(linked[node]) != len(roots) {
				return 0 // 连接数只能和根节点数量相同
			}
			continue
		}
		// 否则是一个集合，递归处理，先过滤出这个子集的边
		var subPairs [][]int
		for _, pair := range pairs {
			// 包含根节点的去掉
			if roots[pair[0]] || roots[pair[1]] {
				continue
			}
			// 某个点在当前子集。如果 pair[0] 在，pair[1] 也一定在，只需要判断一个。
			if subSet[pair[0]] {
				subPairs = append(subPairs, pair)
			}
		}
		ways *= checkWays(subPairs)
		if ways > 2 {
			ways = 2
		} else if ways == 0 {
			return 0
		}
	}
	return ways
}

